import React from 'react';

const SlotM = (props) => {
  let x = props.x;
  let y = props.y;
  let z = props.z;

  if ((x===y) && (y===z)) {
    return(
      <>
      <div className="slot-inner">
        <h1> {x} {y} {z} </h1>
        <h1> This is Macthing </h1>
        <hr />
        </div>
      </>
    )
  } else {
    return(
      <>
      <div className="slot-inner">
        <h1> {x} {y} {z} </h1>
        <h1> This is not Macthing </h1>
        <hr />
      </div>
      </>
    )
  }
}

function App() {
  return (
    <>
      <h1 className="heading"> 🎰 Coding React for <span style={{fontWeight : 'bold', color: 'black'}}>Slot Matching Game</span> 🎰 </h1>

      <SlotM x="😄" y="😄" z="😄"/>
      <SlotM x="😄" y="👶" z="😄"/>
      <SlotM x="🍎" y="🍎" z="🍎"/>
      <SlotM x="🍎" y="🍌" z="🍎"/>
    </>
  );
}

export default App;
